const onClick = async () => {
  const config = {
    closingDate: '2020-12-31', //   
    minOrderQuantity: 1, //   
    maxOrderQuantity: 100, //   
    customerClosingData: '2020-12-31', //    
    stockQuantityMap: {
      1: 10,
      2: 20,
      3: 30,
    }, //  , key:  id, value: 
    limitAmount: 100000, //   
    totalAmountNotation: 2, //    ( 2  )
    vatNotation: 1, //   ( 1  )
    //  ...
  }; //    
  const itemDialog = await openItemDialog(config);

  if (itemDialog.result) {
    const checkedItems = validateItems(itemDialog.items, config);
    if (_.isEmpty(checkedItems)) {
      openToast({ message: '  .' });
    } else {
      // store  .
      mutateDetail(checkedItems);
      // UI 
      updateUIWithItems(checkedItems);
    }
  } else {
    openToast({ message: '  .' });
  }
};
